import React from "react";
import { NavLink, withRouter } from "react-router-dom";
import "./css/navbar.css";

const Navbar = props => {
  //home icon and link
  let homeLink =
    props.location.pathname !== "/" ? (
      <NavLink to="/">
        <img
          className="iconStyle"
          src={require("../imgs/homeIcon.png")}
          alt="homeIcon"
        />
      </NavLink>
    ) : null;

  //profile and sign in link
  const imgIconForProfile = (
    <img
      src={require("../temp/user.png")}
      style={iconStyle}
      alt="profileIcon"
    />
  );

  return (
    <div className="navbar-parent-main-div">
      <span>{imgIconForProfile}</span> <span>{homeLink}</span>
    </div>
  );
};

export default withRouter(Navbar);
